// FIX: Update icon components to accept a `style` prop to fix a type error in App.tsx.
export const DiceIcon = ({ className, face = 1, style }: { className?: string, face?: number, style?: React.CSSProperties }) => {
  const dots = [];
  const dot = (cx: number, cy: number, key: number) => <circle key={key} cx={cx} cy={cy} r="1.5" fill="currentColor" />;
  switch (face) {
    case 1: dots.push(dot(6, 6, 1)); break;
    case 2: dots.push(dot(3, 3, 1), dot(9, 9, 2)); break;
    case 3: dots.push(dot(3, 3, 1), dot(6, 6, 2), dot(9, 9, 3)); break;
    case 4: dots.push(dot(3, 3, 1), dot(9, 3, 2), dot(3, 9, 3), dot(9, 9, 4)); break;
    case 5: dots.push(dot(3, 3, 1), dot(9, 3, 2), dot(6, 6, 3), dot(3, 9, 4), dot(9, 9, 5)); break;
    case 6: dots.push(dot(3, 3, 1), dot(9, 3, 2), dot(3, 6, 3), dot(9, 6, 4), dot(3, 9, 5), dot(9, 9, 6)); break;
  }
  return (
    <svg viewBox="0 0 12 12" className={className} style={style} stroke="none">
        {dots}
    </svg>
  );
};

